import React from "react";
import Header from "./components/Common/Header";
import { Route, BrowserRouter, Switch } from "react-router-dom";
import MainPage from "./pages/MainPage";
const App = () => {
    return (
        <BrowserRouter>
            <Header />
            <Switch>
                <Route exact path="/" component={MainPage} />
            </Switch>
        </BrowserRouter>
    );
};

export default App;
